import "./style.css"
const Navbar = () => {
    const [user, setUser] = useState([])

    const getUser = async () => {
        const response = await fetch("https://jsonplaceholder.typicode.com/posts");
        setUser(await response.json())
    } 

    useEffect(() => {
       getUser();
    }, [])
    return (
        <>
        <div className="main-div">
             <section className="section-div ">
                    <div className="first-s-div" >
                        Hi reader.
                        <img src="" alt="" />
                        <span className="f-s-d-s">Here's Your News!</span>
                        </div>
                        <div  className="second-s-div">
                            <h3>View Toggel</h3>
                            <button className="s-s-d-button"><img src="\images\horizontal_split.svg" alt="" /></button>
                            <button className="s-s-d-button"><img src="\images\vertical_split.svg" alt="" /></button>
                        </div>
    
                       
                        <div className="third-s-div">
                            Have a Feedback?
                            <button className="t-s-d-button">
                                <span>We're Listening!</span>
                                </button>
                        </div>
            </section>

            {
                user.map((curEle) => {
                    return (
                  <div className="container-fluid mt-5">
                <div className="row text-center">
                    <div className="col-10 col-md-4">
                 <h1>helo</h1>
                 <p>pre</p>
                 <img src="" alt="" />
                 <img src="" alt="" />
                 </div>
                 </div>
                 </div>
                    )
                } )
            }
            </div>
            
        </>
    )
}

export default Navbar
